import '../../style/ProjectCard.css'
import WebProjectDisplay from "./WebProjectDisplay";
import MobileProjectDisplay from "./MobileProjectDisplay";
import EmbeddedProjectDisplay from "./EmbeddedProjectDisplay";
import MLProjectDisplay from "./MLProjectDisplay";

const ProjectBody = (props: { project: { type: any; }; }) => {
    switch(props.project.type) {
        case "web":
            return <WebProjectDisplay project={props.project} />
            break;
        case "mobile":
            return <MobileProjectDisplay project={props.project} />
            break;
        case "embedded":
            return <EmbeddedProjectDisplay project={props.project} />
            break;
        case "ml":
            return <MLProjectDisplay project={props.project} />
            break;
        case "media":
            return <MediaProjectDisplay project={props.project} />
            break;
    }
}

const Project = (props: { project: any; type: string; }) => {
    const {project} = props;

    let projectBody = null;

    return (
        <div className="project">
            <div className="project-left">
                <div className="card-container">
                    <h3>{project.title}</h3>
                    <h4>{project.description}</h4>
                    {
                        Array.from(project.stack).map((item: any) => (
                            <div key={item}>
                                {item}
                            </div>
                        ))
                    }
                    {
                        Array.from(project.keywords).map((keyword: any) => (
                            <div key={keyword}>
                                {keyword}
                            </div>
                        ))
                    }
                </div>
            </div>
            <div className="project-right">
                <ProjectBody project={project} />
            </div>
        </div>
    )
}

export default Project;
